import './App.css';
import { Home } from './Pages/Home';
import { AboutMe } from './Pages/AboutMe';
import { BrowserRouter, Switch, Route } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter className="App">
      <Switch>
        <Route path='/'>
          <Home />
        </Route>
        <Route path='/'>
          <AboutMe />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
